script: |
  super -f text -I q5605.spq | sort > q5605.out

inputs:
  - name: q5605.spq
    data: |
      SELECT + col0, + 63 AS col1 FROM tab2 (FORMAT parquet) AS cor0 WHERE NOT 46 + col0 + + col1 + 18 / col1 + col1 IS NULL;
  - name: tab2

outputs:
  - name: q5605.out
    data: |
      46	63
      64	63
      75	63
